<div id="t3_88" class="t s3_88">Fase 3 precipitación:</div>
<div id="t4_88" class="t s4_88">cuando las nubes se </div>
<div id="t5_88" class="t s4_88">forman y contienen cada vez más partículas </div>
<div id="t6_88" class="t s4_88">de agua, puede ocurrir que se libere el agua </div>
